import React from 'react'
import '@coreui/coreui/dist/css/coreui.min.css'

function RecipeCard(props) {
  return (
    <CContainer sm>
        <img alt="Recipe Image" src={props.image} />
        <p>{props.title}</p>
        <h5>{props.summary}</h5>
    </CContainer>
  )
}

export default RecipeCard
